import React, { Component } from 'react'
import { Navbar, Nav,NavDropdown, NavItem, Container } from 'react-bootstrap'
import { Link } from 'react-router-dom'

export default class CustomNavbar extends Component {
    render() {
        return (
            // <Navbar defaulf collapseOnSelect>
            //     <Navbar.Header>
            //         <Navbar.Brand>
            //             <Link to="/">CodeLife</Link>
            //         </Navbar.Brand>
            //         <Navbar.Toggle/>
            //     </Navbar.Header>
            //     <Navbar.Collapse>
            //         <Nav pullRight>
            //             <NavItem eventKey={1} componentClass={Link} to="/">
            //                 Home
            //             </NavItem>
            //             <NavItem eventKey={2} componentClass={Link} to="/about">
            //                 About
            //             </NavItem>
            //             <NavItem eventKey={3} componentClass={Link} to="/news">
            //                 News
            //             </NavItem>
            //         </Nav>
            //     </Navbar.Collapse>
            // </Navbar>
            <Navbar collapseOnSelect expand="lg" bg="primary" variant="dark">
            <Container>
            <Navbar.Brand href="/">CodeLife</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                </Nav>
                <Nav className="pr-3">
                <Nav.Link className="pr-3" href="/"> Home </Nav.Link>
                <Nav.Link className="pr-3" eventKey={2} href="/about"> About </Nav.Link>
                <Nav.Link className="pr-3" eventKey={3} href="/news"> News </Nav.Link>
                </Nav>
            </Navbar.Collapse>
            </Container>
            </Navbar>
        )
    }
}
